import React from 'react'

function nav() {



//IsHomeEnabled?

    function isHomeEnabled(){
        const enabled = window.localStorage.getItem("name");
        if(enabled != null){
            return "/home";
        } else {
            return "#0";
        }
    }
    function isAccountClassEnabled(){
            const classEnabled = window.localStorage.getItem("name");
            if(classEnabled == null){
                return "isDisabled";
            } else {
                return "";
            }
        }


//IsCalendarEnabled?

    function isCalendarEnabled(){
        const enabled = window.localStorage.getItem("name");
        if(enabled != null){
            return "/calendarView";
        } else {
            return "#0";
        }
    }

//IsAccountEnabled?

    function isAccountEnabled(){
        const enabled = window.localStorage.getItem("name");
        if(enabled != null){
            return "/myAccount";
        } else {
            return "#0";
        }
    }

//IsLoginEnabled?

    function isLoginEnabled(){
        window.location.reload();
        const enabled = window.localStorage.getItem("name");
        if(enabled != null){
            return "/login";
        } else {
            return "#0";
        }
    }

    return (
        <div className = "nav">
            <ul className = "nav-ul">
                <li>
                    <a class = {isAccountClassEnabled()} href={isHomeEnabled()}>home</a>
                </li>
                <li>
                    <a class = {isAccountClassEnabled()} href={isCalendarEnabled()}>calendar view</a>
                </li>
                <li>
                    <a class = {isAccountClassEnabled()} href={isAccountEnabled()}>my account</a>
                </li>
                <li>
                    <a class = {isAccountClassEnabled()} href={isLoginEnabled()}>log out</a>
                </li>
            </ul>
        </div>

    )
}

export default nav
